-- Make database and tables

CREATE DATABASE formula1;

USE formula1;

CREATE TABLE circuits(
   circuitId INT NOT NULL PRIMARY KEY, 
  circuitRef VARCHAR(100) NOT NULL,
  name VARCHAR(100) NOT NULL,
  location VARCHAR(100) NOT NULL,
  country VARCHAR(100) NOT NULL
);

CREATE TABLE constructors (
  constructorId  INT  NOT NULL PRIMARY KEY,
  constructorRef VARCHAR(100) NOT NULL,
  name VARCHAR(100) NOT NULL,
  nationality VARCHAR(100) NOT NULL
);

CREATE TABLE drivers(
 driverId INT PRIMARY KEY, 
 driverRef VARCHAR(100),
 number INT,
 code VARCHAR(4),
 surname VARCHAR(100),
 dob DATE,
 nationality VARCHAR(100)
);

CREATE TABLE pitstops(
  raceid   INTEGER  NOT NULL,
  driverid INTEGER  NOT NULL,
  stopping     INTEGER  NOT NULL,
  lap      INTEGER  NOT NULL,
  times     TIME  NOT NULL,
  duration TIME  NOT NULL
);

CREATE TABLE qualifying(
  qualifyId INTEGER PRIMARY KEY NOT NULL,
  raceId INTEGER  NOT NULL,
  driverId INTEGER  NOT NULL,
  constructorId INTEGER  NOT NULL,
  number INTEGER  NOT NULL,
  position INTEGER  NOT NULL,
  q1 TIME,
  q2 TIME,
  q3 TIME
);

CREATE TABLE races(
  raceId      INTEGER PRIMARY KEY NOT NULL,
  year        INTEGER  NOT NULL,
  round       INTEGER  NOT NULL,
  circuitId   INTEGER  NOT NULL,
  name        VARCHAR(30) NOT NULL,
  date        DATE  NOT NULL,
  time        TIME,
  url         VARCHAR(100) NOT NULL,
  fp1_date    DATE,
  fp1_time    TIME,
  fp2_date    DATE,
  fp2_time    TIME,
  fp3_date    DATE,
  fp3_time    TIME,
  quali_date  DATE, 
  quali_time  TIME,
  sprint_date DATE, 
  sprint_time TIME
);

CREATE TABLE results(
  resultId      INTEGER PRIMARY KEY NOT NULL,
  raceId        INTEGER  NOT NULL,
  driverId      INTEGER  NOT NULL,
  constructorId INTEGER  NOT NULL,
  number        INTEGER,
  grid          INTEGER  NOT NULL,
  position      INTEGER,
  points        NUMERIC(4,2) NOT NULL,
  laps          INTEGER  NOT NULL,
  time          VARCHAR(20),
  fastestLap    INTEGER,
  ranking          INTEGER,
  statusId      INTEGER  NOT NULL
);

CREATE TABLE sprintresults(
  resultId       INTEGER PRIMARY KEY NOT NULL,
  raceId         INTEGER  NOT NULL,
  driverId       INTEGER  NOT NULL,
  constructorId  INTEGER  NOT NULL,
  number         INTEGER  NOT NULL,
  grid           INTEGER  NOT NULL,
  position       INTEGER  NOT NULL,
  points         INTEGER  NOT NULL,
  laps           INTEGER  NOT NULL,
  time           VARCHAR(10),
  milliseconds   INTEGER,
  fastestLap     INTEGER,
  fastestLapTime TIME,
  statusId       INTEGER  NOT NULL
);

CREATE TABLE status(
  statusId INTEGER  NOT NULL PRIMARY KEY,
  status   VARCHAR(20) NOT NULL
);

-- Adding foreign key and composite primary key

ALTER TABLE circuits
ADD FOREIGN KEY (circuitId) REFERENCES races(raceId);

ALTER TABLE results
ADD FOREIGN KEY (constructorId) REFERENCES constructors(constructorId),
ADD FOREIGN KEY (driverid) REFERENCES drivers(driverId),
ADD FOREIGN KEY (raceId) REFERENCES races(raceId),
ADD FOREIGN KEY (statusId) REFERENCES status(statusId);

ALTER TABLE sprintresults
ADD FOREIGN KEY (constructorId) REFERENCES constructors(constructorId),
ADD FOREIGN KEY (driverid) REFERENCES drivers(driverId),
ADD FOREIGN KEY (raceId) REFERENCES races(raceId),
ADD FOREIGN KEY (statusId) REFERENCES status(statusId);

ALTER TABLE pitstops
ADD FOREIGN KEY (driverid) REFERENCES drivers(driverId),
ADD FOREIGN KEY (raceid) REFERENCES races(raceId);

ALTER TABLE qualifying
ADD FOREIGN KEY (driverid) REFERENCES drivers(driverId),
ADD FOREIGN KEY (raceId) REFERENCES races(raceId);

ALTER TABLE pitstops
ADD PRIMARY KEY(raceid,driverid,stopping);